window.bookSummaryJSON = "<p>I want her dead, but for a woman like her there is a far worse fate. She may hate me, but she will still be mine.</p> <p>I awoke in hell. I don’t know who I was before, or where I came from. If I ever knew anything but darkness and pain. What I am now is a machine. A weapon, whose every breath is controlled by the technology fused with my very DNA. Bound in eternal servitude.</p> <p>She did this.</p> <p>Doctor Adelaide Thompson made me into the perfect soldier. A protector<i>, </i>incapable of doing her harm. But all I fantasize about is my hands around her throat. Her soft, pink lips gasping for air, and the drum of her pulse under my palms.</p> <p>I hate her. I want her. And I am the only one who can save her life. She won’t like the price....</p> <p><i>Rage</i> is the first book in the dark mate-claim serial, Protector<i>.</i> Brace for twisted romance and evil cliffhangers.</p>"; 
